script: |
  super -f tsv -I q5330.sql | sort > q5330.out

inputs:
  - name: q5330.sql
    data: |
      SELECT - col2 * col1 - CAST ( - col2 AS INTEGER ) + + col0 + - ( - 81 ) + + + col1 AS col2, - 29 col0 FROM tab0 AS cor0;
  - name: tab0

outputs:
  - name: q5330.out
    data: |
      -11	-29
      -3583	-29
      179	-29
